import React from 'react';
import './App.scss';

function App() {
  return (
    <div>
        <div className="header">
          <h3 className="header-title">
            LOGO
          </h3>
          <nav className="header-nav">
            <ul className="header-nav__list">
              <li className="header-nav__item">1</li>
              <li className="header-nav__item">2</li>
              <li className="header-nav__item">3</li>
            </ul>
          </nav>
        </div>
    </div>
  );
}

export default App;
